import React from "react";
const checkboxes = [
  "Include Uppercase Letters",
  "Include Lowercase Letters",
  "Include Numbers",
];
const Checkboxes = () => {
  return <div>{checkboxes.map()}</div>;
};

export default Checkboxes;
